import phone from './images/категории/smartphone_smart.svg';
import tablet from './images/категории/tabletchart_118080.svg1';
import audio from './images/категории/Speaker_icon.svg1';
import access from './images/категории/Office_-22.svg1';
import laptop from './images/категории/32officeicons.svg1';
export default categories = [
{
    name: 'Телефоны',
    img: phone
},
{
    name: 'Планшеты',
    img: tablet
},
{
    name: 'Аудио',
    img: audio
},
{
    name: 'Аксессуары',
    img: access
},
{
    name: 'Ноутбуки',
    img: laptop
},
];
